"use strict";

////////////////CAROUSEL HOME PAGE START //////////////////////////
function nextSlide() {
  var slide = document.querySelectorAll('.cont-img');
  var nbSlides = slide.length;
  var count = 0;
  slide[count].classList.remove('active');

  if (count < nbSlides - 1) {
    count++;
  } else {
    count = 0;
  }

  slide[count].classList.add('active');
}

setInterval(nextSlide, 6000); ////////////////CAROUSEL HOME PAGE END //////////////////////////
////////////////CAROUSEL GAME PAGE START //////////////////////////

(function changeImg() {
  var iframe = document.querySelector('iframe');
  var img = document.querySelector('.img-game');
  var imgMin1 = document.querySelector('.img-game-mini1');
  var imgMin2 = document.querySelector('.img-game-mini2');
  var imgMin3 = document.querySelector('.img-game-mini3');
  var imgMin4 = document.querySelector('.img-game-mini4');
  var imgMin5 = document.querySelector('.img-game-mini5');
  console.log(iframe);
  imgMin1.addEventListener('click', function () {
    iframe.classList.remove('disable');
    iframe.classList.add('active');
    img.classList.remove('active');
    img.classList.add('disable');
  });
  imgMin2.addEventListener('click', function () {
    iframe.classList.remove('active');
    iframe.classList.add('disable');
    img.classList.remove('disable');
    img.classList.add('active');
    img.src = imgMin2.src;
  });
  imgMin3.addEventListener('click', function () {
    iframe.classList.remove('active');
    iframe.classList.add('disable');
    img.classList.remove('disable');
    img.classList.add('active');
    img.src = imgMin3.src;
  });
  imgMin4.addEventListener('click', function () {
    iframe.classList.remove('active');
    iframe.classList.add('disable');
    img.classList.remove('disable');
    img.classList.add('active');
    img.src = imgMin4.src;
  });
  imgMin5.addEventListener('click', function () {
    iframe.classList.remove('active');
    iframe.classList.add('disable');
    img.classList.remove('disable');
    img.classList.add('active');
    img.src = imgMin5.src;
  });
})(); ////////////////CAROUSEL GAME PAGE END //////////////////////////
////////////////COLLAPSE GAME PAGE START //////////////////////////


(function showCollapse() {
  var button = document.querySelector('.collapsible');
  var content = document.querySelector('.content');
  button.addEventListener('click', function () {
    if (content.style.display === 'block') {
      content.style.display = 'none';
      button.innerHTML = 'Voir plus';
    } else {
      content.style.display = 'block';
      button.innerHTML = 'Voir moins';
    }
  });
})(); ////////////////COLLAPSE GAME PAGE END //////////////////////////
